using System;using System.Linq;using System.Text;namespace EntidadesLayout.Ent {	[Serializable]	public class StatusIAF	{		private Guid statusIAFKey;		private string name;		private int? ordern;		public StatusIAF(){}		public Guid StatusIAFKey		{			get { return statusIAFKey; }			set { statusIAFKey = value; }		}		public string Name		{			get { return name; }			set { name = value; }		}		public int? Ordern		{			get { return ordern; }			set { ordern = value; }		}	}}